const data = {
  evData: [
    {
      year: 2018,
      sales: 2070,
    },
    {
      year: 2019,
      sales: 2050,
    },
    {
      year: 2020,
      sales: 2800,
    },
    {
      year: 2021,
      sales: 2090,
    },
    {
      year: 2022,
      sales: 2070,
    },
    {
      year: 2023,
      sales: 2050,
    },
  ],
};

export default data;
